import math

def divisors(num):
    divisors_list = []
    sqrt_num = int(math.sqrt(num))
    for i in range(3, sqrt_num + 1):
        if num % i == 0:
            divisor = i
            quotient = num // i
            if divisor != quotient:
                divisors_list.append(divisor)
            divisors_list.append(quotient)
    return divisors_list

